function renderPage(a){console.log(a);var b=new CanvasJS.Chart("chart",a);doRender(b),$(".nav li a").click(function(a){a.preventDefault(),$(this).tab("show");for(var c=0;c<b.options.data.length;c++)b.options.data[c].type=$(a.target).attr("data-name");doRender(b)})}function doRender(a){a.render(),$(".canvasjs-chart-credit").remove()}